import React from 'react'
import {startReposSaga} from "../../redux";
import { Route } from 'react-router'
import SearchUser from "../../pages/seachUser/searchUser.connected";

class SearchRoute extends React.Component {
    componentDidMount() {
        startReposSaga()
    }
    render(){
        return (
            <React.Fragment>
                <Route  path='/' component={SearchUser} />
            </React.Fragment>
        )
    }
}

export default SearchRoute
